Il revival Gotico mi ha sempre affascinato 🏰

Unisce gli elementi più caratteristici del #Gotico, geometrie e forme ardite, alla concezione romantica del restauro, per cui un edificio antico deve essere toccato il meno possibile e deve mostrare tutta la storia che ha vissuto, lasciando intatti ruderi e cicatrici invase dalla natura. 🥀 👉🏼 Ecco @villagalvagna Giol è un raro e colto esempio di questo gusto per il medioevo e il #romanticismo. E nonostante tutto, viverlo sotto la pioggia per me ha contestualizzato meglio la situazione.

Dopottutto a rinfrancarci dall’umidità e dal maltempo ci hanno pensato i migliori partner per un evento coi fiocchi, date un’occhiata alle stories, specialmente ai piatti clamorosi di @cateringbonapetit 😋

