È una sensazione strana, ma sarà capitata anche a voi. 😶 Quando fai qualcosa di notevole, ti ritrovi improvvisamente che è tutto finito. Il tempo sembra essere passato a velocità doppia, ma al tempo stesso sembrano passati il doppio dei giorni.
.
Come ogni tour il tempo vola in @dolomiti.paganella, ma sembrano trascorsi 10 giorni: nuove amicizie, mille attività, eroiche escursioni, grandi prime volte ed esperienze top.
.
Ecco quindi una carrellata di foto di ieri e oggi, per trasmettervi il turbinio di immagini che affollano ora la mia mente 😍
.
#FeelPaganella #adv @yallersitalia
.
