Tramonto o alba, voi cosa preferite?
.
Sveglia alle 3, trekking tra le tenebre, insetti ingoiati interi e una vista da estasi! 👉🏼 Nonostante la mia camera da letto affacci sul Lago di Molveno e il tramonto sia bellissimo, per me ha vinto l’alba a Fai della Paganella! 🤩
.
Intrufolarsi nella foresta, risalendo i pendii al buio è un’esperienza da fare! E pure il Sup per terminare la giornata👌🏼 .
#FeelPaganella #adv
.
