Un bagno di sudore e adrenalina a 1000!
.
Cercavamo il fresco della montagna, ma questi giorni il caldo anomalo si fa sentire anche qui in @dolomiti.paganella. La cosa ovviamente non ci ha fermato: downhill e trekking sotto un sole cocente e viaaa! 🚵🏼‍♀️
.
Domani alba giusto per non allentare il ritmo! #FeelPaganella #adv
.
